import React from "react";
import { useLocation } from "react-router-dom";
import "../styles/Header.css";

export default function NavBar() {

   let location=useLocation()
   console.log(location)
   switch(location.pathname)
   {
    case "/":
      return (

        <div className="pos-f-t">
        <div className="collapse" id="navbarToggleExternalContent">
          <div className="bg-dark p-4">
            <h4 className="text-white">favoris</h4>
            <span className="text-muted" style={{display:"block"}}></span>
            <span className="text-muted" style={{display:"block"}}>favoris 2</span>
          </div>
        </div>
        <nav className="navbar navbar-dark bg-dark">
          <button className="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarToggleExternalContent" aria-controls="navbarToggleExternalContent" aria-expanded="false" aria-label="Toggle navigation">
            <span className="navbar-toggler-icon"></span>
          </button>
          <button className="button" style={{textAlign:"right"}}>Logout</button>
        </nav>
      </div>

      )



     case "/signUp": 
        return ( <div className="pos-f-t">
        <nav className="navbar navbar-dark bg-dark">
          <button className="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarToggleExternalContent" aria-controls="navbarToggleExternalContent" aria-expanded="false" aria-label="Toggle navigation">
            <span className="navbar-toggler-icon"></span>
          </button>
          <button className="button" style={{textAlign:"right"}}>SignIn</button>
        </nav>
      </div>)


     case "/signIn":
       return (
      
         <button className="button" style={{textAlign:"right"}}>SignUp</button>
       )

     default:
       return (null)
     
   }
    
}
